  true,\n\t\"url\": null,\n\t\"notes\": \"This final report summary describes the
  background, methods, and findings of the Healthy Incentives Pilot (HIP). This pilot
  project enabled SNAP participants to receive an incentive of 30 cents for every
  SNAP dollar spent on targeted fruits and vegetables at participating retailers.
  The comprehensive data concluded that HIP participants consumed 26 percent more
  of targeted fruits and vegetables compared to non-participants. The summary report
  also details the implications for HIP retailer participants and total costs.\",\n\t\"license_title\":
